import 'dart:convert';
import 'dart:typed_data';
import 'dart:ui';

import 'package:umbra_flutter/umbra_flutter.dart';

/// {@template water}
/// A Flutter Widget for the `water` shader.
/// {@endtemplate}
class WaterShader extends UmbraWidget {
  /// {@macro water}
  const WaterShader({
    super.key,
    super.blendMode = BlendMode.src,
    super.child,
    super.errorBuilder,
    super.compilingBuilder,
    required double iTime,
    required Vector2 iMouse,
    required double choppy,
    required double freq,
    required double speed,
    required double height,
  })  : _iTime = iTime,
        _iMouse = iMouse,
        _choppy = choppy,
        _freq = freq,
        _speed = speed,
        _height = height,
        super();

  static Future<FragmentProgram>? _cachedProgram;

  final double _iTime;

  final Vector2 _iMouse;

  final double _choppy;

  final double _freq;

  final double _speed;

  final double _height;

  @override
  List<double> getFloatUniforms() {
    return [
      _iTime,
      _iMouse.x,
      _iMouse.y,
      _choppy,
      _freq,
      _speed,
      _height,
    ];
  }

  @override
  List<ImageShader> getSamplerUniforms() {
    return [];
  }

  @override
  Future<FragmentProgram> program() {
    return _cachedProgram ??
        FragmentProgram.compile(
          spirv: Uint8List.fromList(base64Decode(_spirv)).buffer,
        );
  }
}

const _spirv =
    '';
